// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract MockLP is ERC20 {
    address public minter;
    constructor(string memory name, string memory symbol) ERC20(name, symbol) {
        minter = msg.sender;
    }
    function mint(address to, uint256 amount) external {
        require(msg.sender == minter, "Only minter");
        _mint(to, amount);
    }
}

contract MockDEX {
    // mapping of pair hash to LP token
    mapping(bytes32 => address) public pairLP;

    event LiquidityAdded(address indexed provider, address tokenA, address tokenB, uint256 amountA, uint256 amountB, address lp);
    event Swapped(address indexed user, address fromToken, address toToken, uint256 amountIn, uint256 amountOut);

    function _pairHash(address a, address b) internal pure returns (bytes32) {
        if (a < b) {
            return keccak256(abi.encodePacked(a, b));
        }
        return keccak256(abi.encodePacked(b, a));
    }

    function addLiquidity(address tokenA, address tokenB, uint256 amountA, uint256 amountB) external returns (address) {
        require(amountA > 0 && amountB > 0, "Invalid amounts");
        IERC20(tokenA).transferFrom(msg.sender, address(this), amountA);
        IERC20(tokenB).transferFrom(msg.sender, address(this), amountB);

        bytes32 h = _pairHash(tokenA, tokenB);
        address lpAddr = pairLP[h];
        if (lpAddr == address(0)) {
            // deploy a new LP token
            string memory name = "Mock LP";
            string memory symbol = "MLP";
            MockLP lp = new MockLP(name, symbol);
            lpAddr = address(lp);
            pairLP[h] = lpAddr;
        }

        // mint LP equal to sum of amounts for simplicity
        MockLP(lpAddr).mint(msg.sender, amountA + amountB);

        emit LiquidityAdded(msg.sender, tokenA, tokenB, amountA, amountB, lpAddr);
        return lpAddr;
    }

    // simple 1:1 swap using contract reserves
    function swap(address fromToken, address toToken, uint256 amountIn) external returns (uint256) {
        require(amountIn > 0, "Invalid amount");
        // transfer from user to dex
        IERC20(fromToken).transferFrom(msg.sender, address(this), amountIn);

        // simplistic pricing: 1:1, ensure dex has enough to send
        uint256 reserve = IERC20(toToken).balanceOf(address(this));
        require(reserve >= amountIn, "Insufficient liquidity");

        // send to user
        IERC20(toToken).transfer(msg.sender, amountIn);

        emit Swapped(msg.sender, fromToken, toToken, amountIn, amountIn);
        return amountIn;
    }
}

